import React from 'react'
import './newsOffers.css'
import Records from './records.json'
function newsOffers() {
    return (


        <>
        <div className="stock-container">
          {Records.map((data, key) => {
            return (
              <div key={key}>
                {data.company +
                  " , " +
                  data.ticker +
                  " ," +
                  data.stockPrice +
                  ", " +
                  data.timeElapsed}
              </div>
            );
          })}
        </div>
      </>

    )
}

export default newsOffers
